import React from "react";

import Titulo from "./Titulo/Titulo";
import SearchBar from "./SearchBar/SearchBar";
import styled from './Nav.module.css'
import { Link } from "react-router-dom";
import icoAbout from "../../assets/imagen/icoAbout.png"


function Nav(props) {
   
   return(
   <div className= {styled.continerNav} >
    
     <div className={styled.navBar} >
        <img src={icoAbout}/>
       <Link  to='/about' className={styled.aHome}  >   About </Link >
       <Link to = '/home' className={styled.aHome} >Home</Link>
       <Link to = "favorites" className={styled.aHome}>Favorites</Link>
     </div>
      <Titulo />
     <SearchBar onSearch={(characterID)=> props.onSearch(characterID)} logOut = {props.logOut} ></SearchBar>
   </div>

   ) 
}

export default Nav ;
